/**
 * 
 * 懒加载动态路由 
 */
function lazy(path) {
    //return  resolve => require(["@/components/" + name + ".vue"], resolve)
    return getComponetByPath(path);
}
function getComponetByPath(path) {
    for (var i = 0; i < dynamicRouter.length; i++) {
        var route = dynamicRouter[i];
        if (route.path == path) {
            console.log(route.component)
            return route.component;
        }
    }
}
/**
 * 路由定义
 * path跟配置里的资源标示对应,同时跟url地址对应
 */
var dynamicRouter = [
    {
        path: '/embroidery',
        component: resolve => require(['@/components/embroidery/embroidery.vue'], resolve),
        meta: {
            title: '绣花区任务'
        }
    }, {
        path: '/prolinesetting',
        component: resolve => require(['@/components/proline/prolinesetting.vue'], resolve),
        meta: {
            title: '生产线设置'
        }
    }, {
        path: '/monitorline',
        component: resolve => require(['@/components/proline/monitorline.vue'], resolve),
        meta: {
            title: '监控水位线'
