    {
        path: '/menuManagement',
        component: resolve => require(['@/components/systemManagement/menuManagement.vue'], resolve),
        meta: {
            title: '菜单管理'
        }
    }, {
        path: '/roleManagement',
        component: `resolve => require(['@/components/systemManagement/roleManagement.vue'], resolve)`,
        meta: {
            title: '角色管理'
