    }, {
        path: '/tenantManagement',
        component: `resolve => require(['@/components/systemManagement/tenantManagement.vue'], resolve)`,
        meta: {
            title: '租户管理'
        },
    },
    /*
     *  一体机管理
     */
    {
        path: '/subcontractingTableList',
        component: `resolve => require(['@/components/integratedMachineManagement/subcontractingTableList.vue'], resolve)`,
        meta: {
            title: '分包桌排单'
        },
    },
    /*
     *  PDA系统
     */
    {
        path: '/subcontractingTableList',
        component: `resolve => require(['@/components/pda.vue'], resolve)`,
        meta: {
            title: 'PDA系统'
        },
    },
    /*
     *  裁次管理
     */
    {
        path: '/pccutmsg',
        component: `resolve => require(['@/components/pccutmsg.vue'], resolve)`,
        meta: {
            title: '裁次管理'
        },
    },
    {
        path: '/pccuttask',
        component: `resolve => require(['@/components/pccutmsg/pccuttask.vue'], resolve)`,
        meta: {
            title: '裁次任务'
        },
    },
    {
        path: '/pccutmsgstock',
        component: `resolve => require(['@/components/pccutmsg//pccutmsgstock.vue'], resolve)`,
        meta: {
            title: '裁次管理'
        },
    },
    /*
     *  裁次管理
     */
    {
        path: '/pccutmsg',
        component: `resolve => require(['@/components/pccutmsg.vue'], resolve)`,
        meta: {
            title: '裁次管理'
        },
    },
    {
        path: '/pccuttask',
        component: `resolve => require(['@/components/pccutmsg/pccuttask.vue'], resolve)`,
        meta: {
            title: '裁次任务'
        },
    },
];
